'''Rune trimmed armour''' is a possible reward from [[Clue scroll (hard)|hard]] [[Treasure Trails]]. The set has identical stats to [[Rune armour]], except for the kiteshield's ranged attack bonus being -2 (rather than -3). The armour pieces '''cannot''' be made via the [[Smithing]] skill.

